import { Header } from 'semantic-ui-react'
import MainNav from "../Nav/mainNav";

function HeaderContent() {
  return (
    <div>
          <Header as='h3' textAlign='center'>
      Centered
    </Header>
      <MainNav />
    </div>
  )
}

export default HeaderContent;
